import React from 'react'

function Square(props) {
    return (<div className='square' style={{ backgroundColor: props.color }}>
        {props.info.title}<br />
        <span>{props.info.description}</span><br />
        {
            props.info.links.map((link, index) => <button key={index} className='btn'><a href={link.url}>{link.title}</a></button>)
        }

    </div>);
}

export default Square
